import React from 'react';
import './Navbar.css';

import Logo from '../images/logo.png'

function Nav() {
  return (
    <div>
        <img src={{Logo}} className='logo-image'/>
        <div className='navbar'>
        
           <ul>
            <li>Home</li>
            <li>Kids</li>
            <li>Tech</li>
            <li>Food</li>
            <li>Resturant</li>
            </ul> 
            
            
            
        </div>
        
        
    </div>
  );
}

export default Nav;
